import {Component, OnInit} from '@angular/core';
import {UntypedFormControl, UntypedFormGroup, Validators} from "@angular/forms";
import {Router} from "@angular/router";
import {ToastrService} from "ngx-toastr";
import {Observable} from "rxjs";
import {tap} from "rxjs/operators";

import {AuthService} from "../shared/services/auth.service";
import {PostService} from "../shared/services/post.service";
import {PostInterface} from "../shared/interfaces/post.interface";

@Component({
  selector: 'app-create-page',
  templateUrl: './create-page.component.html',
  styleUrls: ['./create-page.component.scss']
})
export class CreatePageComponent implements OnInit {

  form: UntypedFormGroup | any;
  createPost$: Observable<any> | undefined;

  constructor(
    private postsService: PostService,
    private toastrService: ToastrService,
    private router: Router,
    private authService: AuthService
  ) {
  }

  ngOnInit(): void {
    this.initialize();
  }

  initialize() {
    this.form = new UntypedFormGroup({
      title: new UntypedFormControl(null, [Validators.required]),
      text: new UntypedFormControl(null, [Validators.required]),
      author: new UntypedFormControl(null, [Validators.required]),
    });
  }

  submit() {
    if (this.form.invalid) {
      return
    }
    const userData = this.authService.getProfileData().getValue();
    const post: PostInterface = {
      title: this.form.value.title,
      text: this.form.value.text,
      author: this.form.value.author,
      date: new Date(),
      emailOwner: userData?.userEmail ? userData.userEmail : ''
    }
    this.createPost$ = this.postsService.create(post).pipe(
      tap(() => {
        this.form.reset();
        this.router.navigate(['/admin/dashboard']);
        this.toastrService.success('Post created');
      })
    )
  }

}
<form [formGroup]="form" (ngSubmit)="submit()">
  <h1>Create new post</h1>

  <div
    [ngClass]="{invalid: form.get('email')?.touched && form.get('email').invalid}"
    class="form-control">
    <label for="title">Post name</label>
    <input id="title" type="text" formControlName="title">
    <div *ngIf="form.get('title').touched && form.get('title').invalid"
         class="validation">
      <small *ngIf="form.get('title').errors?.required">
        Enter the title of the post
      </small>
    </div>
  </div>

  <div class="form-control">
    <label>The content of the post:</label>
    <quill-editor formControlName="text"></quill-editor>
  </div>

  <div
    class="form-control"
    [ngClass]="{invalid: form.get('email')?.touched && form.get('email').invalid}"
  >
    <label for="author">Author of the post</label>
    <input id="author" type="text" formControlName="author">
    <div *ngIf="form.get('author').touched && form.get('author').invalid"
         class="validation">
      <small *ngIf="form.get('author').errors?.required">
        Enter the author of the post
      </small>
    </div>
  </div>

  <button
    mat-raised-button
    type="submit"
    [disabled]="form.invalid">
    Create post
  </button>

</form>
<ng-container *ngIf="createPost$ | async"></ng-container>
